var artifactId = Get<Guid>("SrmArtifact");
var artifactName = Get<string>("SrmArtifactName");

var emailTemplateId = SrmApprovalServiceConstantsCS.EmailTemplate.SendApprovalRequest;
var emailTemplate = SrmEmailHelper.GetEmailTemplate(UserConnection, emailTemplateId);
var body = emailTemplate.GetTypedColumnValue<string>("Body");
var baseUrl = SrmEmailHelper.GetApplicationBaseUrl(UserConnection);

var newBody = SrmEmailHelper.GetEmailBodyWithParams(UserConnection, body, new Dictionary<string, string>
{
	{ "[#SiteUrl#]", baseUrl },
	{ "[#Id#]", artifactId.ToString() },
	{ "[#SrmArtifactName#]", artifactName }
});

Set("EmailTemplateUserTask.Body", newBody);

return true;
